import React, { Component } from 'react';
import './App.css';

import {
    Container,
    Icon,
    Link,
    List,
    ListItem,
    Offcanvas,
    OffcanvasContainer,
    Navbar,
    NavbarContainer,
    NavbarSticky,
    Section,
} from 'uikit-react';

class App extends Component {
  render() {
    return (
      <Container/>
    );
  }
}

export default App;
